import React from 'react';
import Fullpage, {
  FullPageSections,
  FullpageSection,
  FullpageNavigation,
} from '@ap.cx/react-fullpage';

const Test = () => {
  return (
    <Fullpage>
      <FullPageSections>
        <FullpageSection style={{ height: '100vh' }}>
          <h1>Screnn 1</h1>
        </FullpageSection>
      </FullPageSections>
    </Fullpage>
  );
};

export default Test;
